import './App.css';
import ChatView from './Components/ChatScreen/ChatView';
import SideBar from './Components/SideBar/SideBar';
import {Route, Redirect, Switch, useLocation} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Switch>

      <Route path="/id">
        <div className="flex flex-row">
        <SideBar/>
        <ChatView/>
        </div>
      </Route>
      <Route path="/">
        <SideBar/>
      </Route>

      </Switch>
    </div>
  );
}

export default App;
